 AS 的副表别名来做区分，put 进 childMap。\n*/',NULL,NULL,NULL,'','2020-03-13 15:37:03',NULL),(1584117747580,0,2000,0,3,'全局默认字段失效','JSON','/login','{\n    \"type\": 0,\n    \"phone\": \"13000082001\",\n    \"password\": \"123456\",\n    \"version\": 1,\n    \"remember\": false,\n    \"format\": true,  //失效\n    \"defaults\": {  //失效\n        \"format\": true,\n        \"@explain\": true,\n        \"@database\": \"POSTGRESQL\",\n        \"@schema\": \"sys\"\n    }\n}',NULL,NULL,NULL,'','2020-03-13 16:42:27',NULL),(1584118278602,0,2000,0,3,'SIDE JOIN 实现可能有误','JSON','/get','{\n    \"[]\": {\n        \"join\": \"^/User/id@\",\n        \"Comment\": {\n            \"momentId\": 12\n        },\n        \"User\": {\n            \"id@\": \"/Comment/toId\",\n            \"sex\": 0\n        }\n    },\n    \"@explain\": true\n}\n/*\n SIDE JOIN 实现可能有误，并且性能不大好。\n Comment 的条件 A: momentId=12\n User 的条件 B: sex=0\n 理论上 NOT(A AND B) 等价于(A AND NOT B) OR (B AND NOT A) \n 目前使用的是后者，当我想要改成前者，分别用对应的 SQL 放数据库执行，\n 发现结果集不一样！\n SELECT `Comment`.*, `User`.* FROM `sys`.`Comment` AS `Comment` INNER JOIN `sys`.`apijson_user` AS `User` ON `User`.`id` = `Comment`.`toId` WHERE ( NOT ( `Comment`.`momentId` = 12 AND `User`.`sex` = 0 ) ) LIMIT 10 OFFSET 0\n SELECT `Comment`.*, `User`.* FROM `sys`.`Comment` AS `Comment` INNER JOIN `sys`.`apijson_user` AS `User` ON `User`.`id` = `Comment`.`toId` WHERE ( ( ( (`Comment`.`momentId` = 12) ) AND NOT ( ( (`User`.`sex` = 0) ) ) ) OR ( ( (`User`.`sex` = 0) ) AND NOT ( ( (`Comment`.`momentId` = 12) ) ) ) ) LIMIT 10 OFFSET 0\n*/',NULL,NULL,NULL,'','2020-03-13 16:51:18',NULL),(1584120971519,0,2020,0,3,'新增 WITH AS','JSON','/get','{   //看看关注的人最近有什么动态（分享、评论）\n    \"sql@\": {\n        \"with\": true,  //生成 WITH(SELECT id ...) AS `sql`\n        \"from\": \"User\",\n        \"User\": {\n            \"@column\": \"id\",\n            \"@role\": \"CONTACT\"\n        }\n    },\n    \"Moment[]\": {\n        \"Moment\": {\n            \"userId{}@\": \"sql\",\n            \"@order\": \"date-